import React, { forwardRef } from "react";
import Typewriter from "typewriter-effect";
import comet from "./images/myColor1";
import "animate.css";

const Home = (props, ref) => {
  return (
    <div className="homeBodyContainer">
      <img src={comet} alt="Comet"></img>
      <div className="matrixText">
        <Typewriter
          onInit={(typewriter) => {
            typewriter
              .changeDeleteSpeed(30)
              .changeDelay(100)
              .pauseFor(200)
              .typeString("Welcome to my little slice of paradise.")
              .pauseFor(400)
              .deleteAll()
              .typeString("I'm Mark Johnston and this is my site")
              .start();
          }}
        />
      </div>
      <nav>
        <ul>
          <li>About Me</li>
          <li>My Projects</li>
          <li>Contact Me</li>
        </ul>
      </nav>
    </div>
  );
};

export default forwardRef(Home);
